import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';


// STORE
// {
//   counter:0
// }

// ACTIONS
const increment = () => {
  return {
    type: 'Increment'
  }
}

const decrement = () => {
  return {
    type: 'Decrement'
  }
}

// REDUCER
const counter = (state, action) => {
  switch(action.type) {
    case "Increment":
      return state + 1
      case "Decrement":
        return state - 1
  }
}




const root = ReactDOM.createRoot(document.getElementById('root'));
